import { useNavigate } from 'react-router'
import fbpreto from "./fbpreto.png"
import instabranco from "./instabranco.png"

function Header() {
    const navigate = useNavigate();
  return (
    <div>
      <header className="logo-header">
          <h1>Beto Hott</h1>
          <h4>Música para eventos</h4>
          <h4 className="social-media">Vídeos</h4>
          <img className="social-media" onClick={() => navigate("https://web.facebook.com/alberto.hott.5") } src={fbpreto}alt="fb" width="20"></img>
          <img className="social-media" src={instabranco}alt="fb" width="20"></img>
      </header>
    </div>
  );
}

export default Header;
